A new 
@CDCMMWR
 on US emergency department visits during #COVID19 finds a larger proportion of emergency department patients are seeking care for mental and behavioral health-related concerns; http://bit.ly/7015a3.

Of nearly 7 million doses of J&J/Janssen #COVID19 Vaccine given in the US, a small number of cases of a rare & severe type of blood clot have been reported in people after receiving the vaccine. CDC & 
@US_FDA
 recommend a pause as we review data. More: https://bit.ly/3acYSnz

A new 
@CDCMMWR
 finds that in northern Montana’s Blackfeet Tribal Reservation, stay-at-home orders and mask requirements were associated with a 33-fold drop in rate of new #COVID19 cases during Fall 2020. Learn more: http://bit.ly/7014a3.

