@CDCMMWR
 finds in Montana during Mar–Nov 2020, the rate of new #COVID19 cases among American Indian or Alaska Native persons was more than 2x that among White persons. Rate of COVID-19 deaths among AI/AN persons was nearly 4x that among White persons. http://bit.ly/7014a2

A new 
@CDCMMWR
 shows how a contact tracing program managed by Spirit Lake Tribe in North Dakota was effective at reaching tribe members affected by #COVID19. This program might help inform similar programs in other tribes and the public health community. http://bit.ly/mm7014a4

